ms":[],"example":"The candle burns blue."},{"definition":"Supportive of, run by (a member of), pertaining to, or dominated by a political party represented by the colour blue.","synonyms":[],"antonyms":[]},{"definition":"Of the higher-frequency region of the part of the electromagnetic spectrum which is relevant in the specific observation.","synonyms":[],"antonyms":[]},{"definition":"(of steak) Extra rare; left very raw and cold.","synonyms":[],"antonyms":[]},{"definition":"(of a dog or cat) Having a coat of fur of a slaty gray shade.","synonyms":[],"antonyms":[]},{"definition":"Severe or overly strict in morals; gloomy.","synonyms":[],"antonyms":[],"example":"blue and sour religionists;  blue laws"},{"definition":"(of women) literary; bluestockinged.","synonyms":[],"antonyms":[]},{"definition":"Having a color charge of blue.","synonyms":[],"antonyms":[]},{"definition":"(entertainment) Risque or obscene","synonyms":[],"antonyms":[],"example":"His material is too blue for prime-time"}],"synonyms":[],"antonyms":["nonblue","unblue","antiblue"]}],"license":{"name":"CC BY-SA 3.0","url":"https://creativecommons.org/licenses/by-sa/3.0"},"sourceUrls":["https://en.wiktionary.org/wiki/blue"]},{"word":"blue","phonetic":"/bluː/","phonetics":[{"text":"/bluː/","audio":"https://api.dictionaryapi.dev/media/pronunciations/en/blue-au.mp3","sourceUrl":"https://commons.wikimedia.org/w/index.php?curid=75268085","license":{"name":"BY-SA 4.0","url":"https://creativecommons.org/licenses/by-sa/4.0"}},{"text":"/bluː/","audio":"https://api.dictionaryapi.dev/media/pronunciations/en/blue-uk.mp3","sourceUrl":"https://commons.wikimedia.org/w/index.php?curid=9014288","license":{"name":"BY 3.0 US","url":"https://creativecommons.org/licenses/by/3.0/us"}},{"text":"/blu/","audio":"https://api.dictionaryapi.dev/media/pronunciations/en/blue-us.mp3","sourceUrl":"https://commons.wikimedia.org/w/index.php?curid=839240","license":{"name":"BY-SA 3.0","url":"https://creativecommons.org/licenses/by-sa/3.0"}},