(33, 'fallen', 'fallen', 2, '{"pronunciation":{"us":"https://api.dictionaryapi.dev/media/pronunciations/en/fallen-us.mp3","uk":null,"other":null},"content":[{"word":"fallen","phonetic":"/ˈfɔːlən/","phonetics":[{"text":"/ˈfɔːlən/","audio":""},{"text":"/ˈfɔlən/","audio":"https://api.dictionaryapi.dev/media/pronunciations/en/fallen-us.mp3","sourceUrl":"https://commons.wikimedia.org/w/index.php?curid=1244050","license":{"name":"BY-SA 3.0","url":"https://creativecommons.org/licenses/by-sa/3.0"}}],"meanings":[{"partOfSpeech":"verb","definitions":[{"definition":"(heading) To be moved downwards.","synonyms":[],"antonyms":[]},{"definition":"To move downwards.","synonyms":[],"antonyms":[]},{"definition":"To happen, to change negatively.","synonyms":[],"antonyms":[]},{"definition":"To be allotted to; to arrive through chance, fate, or inheritance.","synonyms":[],"antonyms":[],"example":"And so it falls to me to make this important decision.  The estate fell to his brother; the kingdom fell into the hands of his rivals."},{"definition":"To diminish; to lessen or lower.","synonyms":[],"antonyms":[]},{"definition":"To bring forth.","synonyms":[],"antonyms":[],"example":"to fall lambs"},{"definition":"To issue forth into life; to be brought forth; said of the young of certain animals.","synonyms":[],"antonyms":[]},{"definition":"To descend in character or reputation; to become degraded; to sink into vice, error, or sin.","synonyms":[],"antonyms":[]},{"definition":"To become ensnared or entrapped; to be worse off than before.","synonyms":[],"antonyms":[],"example":"to fall into error;  to fall into difficulties"},{"definition":"To assume a look of shame or disappointment; to become or appear dejected; said of the face.","synonyms":[],"antonyms":[]},{"definition":"To happen; to come to pass; to chance or light (upon).","synonyms":[],"antonyms":[]},{"definition":"To begin with haste, ardour, or vehemence; to rush or hurry.","synonyms":[],"antonyms":[],"example":"After arguing, they fell to blows."},{"definition":"To be dropped or uttered carelessly.","synonyms":[],"antonyms":[],"example":"An unguarded expression fell from his lips."},{"definition":"(of a fabric) To hang down (under the influence of gravity).","synonyms":[],"antonyms":[],"example":"An Empire-style dress has a high waistline – directly under the bust – from which the dress falls all the way to a hem as low as the floor."}],"synonyms":["responsibility","up to","become","get","come down","descend","drop","drop","lower","prostrate","die","drop","plummet","plunge","beaten","defeated","overthrown","smitten","vanquished","cut down","fell","knock down","knock over","strike down","dip","drop"],"antonyms":["ascend","go","rise","get up","pick oneself up","stand up","beat","defeat","overthrow","smite","vanquish","rise"]},{"partOfSpeech":"noun","definitions":[{"definition":"The dead.","synonyms":[],"antonyms":[]},{"definition":"Casualties of battle or war.","synonyms":[],"antonyms":[]},{"definition":"One who has fallen, as from grace.","synonyms":[],"antonyms":[]}],"synonyms":[],"antonyms":[]},{"partOfSpeech":"adjective","definitions":[{"definition":"Having dropped by the force of gravity.","synonyms":[],"antonyms":[],"example":"fallen raindrops"},{"definition":"Killed in battle.","synonyms":[],"antonyms":[],"example":"to honor fallen soldiers"},{"definition":"Having lost one''s chastity.","synonyms":[],"antonyms":[],"example":"a fallen woman"},{"definition":"Having collapsed.","synonyms":[],"antonyms":[],"example":"a fallen building"},{"definition":"Having lost prestige, (Christian) grace, etc.","synonyms":[],"antonyms":[]}],"synonyms":["collapsed"],"antonyms":[]}],"license":{"name":"CC BY-SA 3.0","url":"https://creativecommons.org/licenses/by-sa/3.0"},"sourceUrls":["https://en.wiktionary.org/wiki/fall","https://en.wiktionary.org/wiki/fallen"]}]}', '2023-06-12 00:02:58', NULL);

